import React from "react";
import { Link } from "react-router-dom";
import { FaChess } from "react-icons/fa"; // Use an icon library like FontAwesome

const Home = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Welcome to the Chess Game</h1>
      <p>Click the chess icon to start playing</p>
      <Link to="/chess">
        <FaChess size={100} style={{ cursor: "pointer", color: "#555" }} />
      </Link>
    </div>
  );
};

export default Home;
